webpackJsonp([9501622846743],{1059:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/augmented-reality-with-flash/index.md absPath of file >>> MarkdownRemark",html:'<p>Here\'s another "wow" project - FLARToolKit (<strong>FL</strong>ash <strong>A</strong>ugmented <strong>R</strong>eality <strong>ToolKit</strong>)</p>\n<p><object classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" width="425" height="344" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0"><param name="src" value="http://www.youtube.com/v/5-_Mf722QlM&amp;rel=0" /><embed type="application/x-shockwave-flash" width="425" height="344" src="http://www.youtube.com/v/5-_Mf722QlM&amp;rel=0"></embed></object></p>\n<p>Your webcam, little bit of Papervision, the FLARToolKit, and you\'re off.</p>\n<p>It\'s similar technology to that which powers "Eye of Judgement", and is pretty cool.Â  If you\'ve got a webcam go and scribble a large black box onto a bit of paper and <a href="http://saqoosha.net/lab/FLARToolKit/2/">test it out</a>.</p>\n<p>Kudos to <a href="http://blog.makemepulse.com/2008/06/04/flartookit-augmented-reality-in-flash/">Make me pulse</a> and <a href="http://gamesalfresco.com/">Games Alfresco</a> for finding the link in the first place!</p>',frontmatter:{title:"Augmented Reality with Flash",date:"June 05, 2008",tags:["flash","augmented-reality","papervision","webcam"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/facebook-security/",tags:null,title:"Facebook security?!",date:"2008-05-30T21:10:51.000Z"}},next:{frontmatter:{path:"/blog/the-terminator-fiction/",tags:["bbci"],title:"The Terminator: Fiction?",date:"2008-06-07T19:35:52.000Z"}}}}}});
